description:
Kiss My Ass Tat 

Sarah Jessie &amp; Romi Rain

ham Hot And Mean November 27, 2012



Romi Rain has a cosmetic emergency: she wants her tattoo of her cheating husband's name covered up immediately. Sarah's tattoo parlor is the only place around, and she's about to close. Romi begs her to take care of it, and shows her the offending ass tat. Sarah feels bad hearing Romi complain about the awful sex she had with her ex, and decides to treat Romi's tattooed ass to more than she bargained for. 



